import React from 'react'
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';


import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';



interface TabPanelProps {
  children?: React.ReactNode;
  index: number;
  value: number;
}


function a11yProps(index: number) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}


const Header = () =>{

  const [value, setValue] = React.useState(0);

  const handleChange = (event: React.SyntheticEvent, newValue: number) => {
    setValue(newValue);
  };

    return (
        <AppBar style={{width: 'calc(100% - 240px)'}}>
        <Toolbar indicatorColor="secondary" style={{ minHeight: '48px' }}>
          <Tabs  value={value} onChange={handleChange} aria-label="basic tabs example">
            <Tab sx={{color: 'white'}} label="Заказы" {...a11yProps(0)} />
            <Tab sx={{color: 'white'}} label="Заказы в работе" {...a11yProps(1)} />
            <Tab sx={{color: 'white'}} label="Заказы в архиве" {...a11yProps(2)} />
          </Tabs>
        </Toolbar>
        </AppBar>
    )
}


export default Header;
